            "visualizaQuestao": "<div class=\"adaptive-block-avalicao-visualize\">\t\n\t\t\n\t\t\n\t\t\n\t\t\n\t\t\t\t\t\t\t\t\t\t\n\t\t\n\t\t<div   class=\"ng-binding ng-scope\"><p style=\"text-align:justify;\">Os glicocorticoides são hormônios esteroides que são produzidos no córtex da glândula adrenal, dentre estes, são conhecidos o cortisol <strong>(1)&nbsp;</strong>e a corticosterona&nbsp;<strong>(2)</strong>. Esses hormônios são anti-inflamatórios que têm sido utilizados na terapia contra o câncer. Suas estruturas são mostradas na figura a seguir.</p><p style=\"text-align:center;\"><img src=\"data:image/jpeg;base64,\" width=\"445\" height=\"181\"></p><p style=\"text-align:justify;\">Acerca das estruturas do cortisol e da cortisona, assinale a alternativa correta.</p></div>\n\t\t\n\t\t<div class=\"coluna-sm-12 adaptive-margin-bottom\">\n\t\t\t<div class=\"linha-alternativa ng-scope\"  >\n\t\t\t\t<span class=\"media-esq ng-binding\" >A (&nbsp;&nbsp;&nbsp;)</span>\n\t\t\t\t<span class=\"media-corpo ng-binding\" ><p>O cortisol e a corticosterona são substâncias opticamente ativas e são enantiômeros.</p></span>\n\t\t\t</div><div class=\"linha-alternativa ng-scope\"  >\n\t\t\t\t<span class=\"media-esq ng-binding\" >B (&nbsp;&nbsp;&nbsp;)</span>\n\t\t\t\t<span class=\"media-corpo ng-binding\" ><p>O cortisol apresenta 7 centros estereogênicos e a corticosterona 6, sendo que os dois compostos são diastereoisômeros.</p></span>\n\t\t\t</div><div class=\"linha-alternativa ng-scope\"  >\n\t\t\t\t<span class=\"media-esq ng-binding\" >C (&nbsp;&nbsp;&nbsp;)</span>\n\t\t\t\t<span class=\"media-corpo ng-binding\" ><p>O cortisol e a corticosterona apresentam 7 centros estereogênicos, são opticamente ativos e não são isômeros.</p></span>\n\t\t\t</div><div class=\"linha-alternativa ng-scope\"  >\n\t\t\t\t<span class=\"media-esq ng-binding\" >D (&nbsp;&nbsp;&nbsp;)</span>\n\t\t\t\t<span class=\"media-corpo ng-binding\" ><p>O cortisol é opticamente ativo, portanto, apresenta enantiômeros, enquanto a corticosterona é uma substância opticamente inativa.</p></span>\n\t\t\t</div><div class=\"linha-alternativa ng-scope\"  >\n\t\t\t\t<span class=\"media-esq ng-binding\" >E (&nbsp;&nbsp;&nbsp;)</span>\n\t\t\t\t<span class=\"media-corpo ng-binding\" ><p>O cortisol e a corticosterona se misturados em quantidades equimoleculares formam uma mistura racêmica e não desviam o plano da luz polarizada.</p></span>\n\t\t\t</div>\n\t\t</div>\t\n\t</div>",
