            "visualizaQuestao": "<div class=\"adaptive-block-avalicao-visualize\">\t\n\t\t\n\t\t\n\t\t<div   class=\"ng-binding ng-scope\"><p style=\"text-align:justify;\">Os principais inseticidas têm em sua composição as seguintes substâncias:</p><figure class=\"image image-style-align-center\"><img style=\"aspect-ratio:511/226;\" src=\"data:image/jpeg;base64,\" width=\"511\" height=\"226\"></figure><p style=\"text-align:justify;\">Observe que estas substâncias têm uma parte da fórmula em comum, característica dos piretróides.&nbsp;</p></div>\n\t\t\n\t\t<div  style=\"padding-bottom: 12px;\" class=\"ng-scope\"></div>\t\t\t\t\t\t\t\t\n\t\t\n\t\t<div   class=\"ng-binding ng-scope\"><p style=\"text-align:justify;\">A respeito dessas fórmulas são feitas as seguintes proposições:&nbsp;</p><p style=\"text-align:justify;\">&nbsp;</p><p style=\"text-align:justify;\">I. As três estruturas apresentam a função éster.&nbsp;</p><p style=\"text-align:justify;\">II. Além da função éster, a transflutrina apresenta a função haleto orgânico.&nbsp;</p><p style=\"text-align:justify;\">III. A cipermetrina apresenta na sua estrutura as funções éster, éter e amina.&nbsp;</p><p style=\"text-align:justify;\">IV. A imiprotrina apresenta na sua estrutura as funções éster, amina e cetona.&nbsp;</p><p style=\"text-align:justify;\">V. A cipermetrina apresenta na sua estrutura três centros de quiralidades.&nbsp;</p><p style=\"text-align:justify;\">&nbsp;</p><p style=\"text-align:justify;\">Assinale a alternativa que indica as proposições verdadeiras:&nbsp;</p></div>\n\t\t\n\t\t<div class=\"coluna-sm-12 adaptive-margin-bottom\">\n\t\t\t<div class=\"linha-alternativa ng-scope\"  >\n\t\t\t\t<span class=\"media-esq ng-binding\" >A (&nbsp;&nbsp;&nbsp;)</span>\n\t\t\t\t<span class=\"media-corpo ng-binding\" ><p>I, II e III.</p></span>\n\t\t\t</div><div class=\"linha-alternativa ng-scope\"  >\n\t\t\t\t<span class=\"media-esq ng-binding\" >B (&nbsp;&nbsp;&nbsp;)</span>\n\t\t\t\t<span class=\"media-corpo ng-binding\" ><p>II, IV e V.</p></span>\n\t\t\t</div><div class=\"linha-alternativa ng-scope\"  >\n\t\t\t\t<span class=\"media-esq ng-binding\" >C (&nbsp;&nbsp;&nbsp;)</span>\n\t\t\t\t<span class=\"media-corpo ng-binding\" ><p>III e IV.</p></span>\n\t\t\t</div><div class=\"linha-alternativa ng-scope\"  >\n\t\t\t\t<span class=\"media-esq ng-binding\" >D (&nbsp;&nbsp;&nbsp;)</span>\n\t\t\t\t<span class=\"media-corpo ng-binding\" ><p>I, II e V.</p></span>\n\t\t\t</div><div class=\"linha-alternativa ng-scope\"  >\n\t\t\t\t<span class=\"media-esq ng-binding\" >E (&nbsp;&nbsp;&nbsp;)</span>\n\t\t\t\t<span class=\"media-corpo ng-binding\" ><p>I, III e V.</p></span>\n\t\t\t</div>\n\t\t</div>\t\n\t</div>",
