                "visualizaQuestao": "{\n  \"fonte\": \"\",\n  \"instrucao\": \"\",\n  \"textoBase\": \"<p style=\\\"text-align:justify;\\\">O Brasil possui uma vasta diversidade de sítios arqueológicos que têm revelado importantes aspectos da história das primeiras populações que habitaram o continente. As pesquisas arqueológicas têm contribuído para o entendimento das práticas culturais e dos modos de vida dos povos indígenas que ali viveram por milênios. Entre as descobertas mais significativas estão os fósseis humanos, que fornecem pistas sobre a adaptação e migração desses grupos no território brasileiro.</p>\",\n  \"comando\": \"<p style=\\\"text-align:justify;\\\">As evidências encontradas no Brasil que indicam a presença de antigos fósseis são caracterizados por</p>\",\n  \"justificarFalsas\": false,\n  \"alternativas\": [\n    \"<p>Homo sapiens, que são originários da África.</p>\",\n    \"<p>mamíferos pré-históricos encontrados no Piauí.</p>\",\n    \"<p>Luzia, que data de cerca de 12 mil anos atrás.</p>\",\n    \"<p style=\\\"text-align:justify;\\\">Fósseis de animais extintos que pertencem a megafauna.</p>\",\n    \"<p>Homo erectus, encontrados em diversas regiões do Brasil.</p>\"\n  ],\n  \"afirmacoes\": [],\n  \"associacoes\": null,\n  \"assercoes\": null\n}",
