                "visualizaQuestao": "{\n  \"fonte\": \"\",\n  \"instrucao\": \"<p>Observe a imagem.&nbsp;</p><p>&nbsp;</p>\",\n  \"textoBase\": \"<p style=\\\"text-align:center;\\\"><img class=\\\"image_resized\\\" style=\\\"width:295px;\\\" src=\\\"data:image/jpeg;base64,\\\"></p><p style=\\\"text-align:center;\\\">&nbsp;</p><p style=\\\"text-align:center;\\\">Os traços da cerâmica marajoara são bastante detalhistas. Para isso, as tribos indígenas aplicavam técnicas que combinavam cores que tornavam as peças sofisticadas. Essas cores eram extraídas de elementos da natureza.&nbsp;</p><p style=\\\"text-align:right;\\\"><sub>Disponível em: https://portalamazonia.com</sub></p><p style=\\\"text-align:right;\\\">&nbsp;</p>\",\n  \"comando\": \"<p>Esse grupo se destacou pela sua cerâmica sofisticada e organização social complexa. A cultura marajoara se localizava-se</p><p style=\\\"text-align:justify;\\\">&nbsp;</p>\",\n  \"justificarFalsas\": false,\n  \"alternativas\": [\n    \"<p style=\\\"text-align:justify;\\\">Ilha de Marajó e nas áreas do estado do Pará.</p>\",\n    \"<p>Ilha de Itararé e nas áreas do estado do Sudeste.</p>\",\n    \"<p>interior do estado do Paraná e no noroeste paulista.</p>\",\n    \"<p>regiões do sertão nordestino, entre os estado da Bahia.</p>\",\n    \"<p>litoral do estado do Maranhão e na região do Rio São Francisco.</p><p>&nbsp;</p>\"\n  ],\n  \"afirmacoes\": [],\n  \"associacoes\": null,\n  \"assercoes\": null\n}",
